import React, { Component } from 'react';
import ReactBootstrap, {Container, Row, Col, FormGroup} from 'react-bootstrap'; 

// IMPORT CHILD
import SuggestionBox from './suggestion-box';

class SearchFruits extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			'word': 'test'
		}
	}
	render() {
	    return (
			<section className='p-3 sec-block search-fruits'>
				<Container>
					<h1>Search your Fruit</h1>
					<hr/>
					<div className='std-wrapper'>
						<form>
							<label htmlFor='search-fruit'>
								Enter a fruit...
							</label>
							<input 
								type='text'
								autoCorrect='on'
								autoFocus='on'
								aria-required='true'
								name='search-fruit'
								className='inp-std'
								id='search-fruit'
							/>
							<input 
								type='submit'							
								value='Search'
								className='ml-3 btn-std'
								id='find-fruit'
							/>
						</form>
						<SuggestionBox />
					</div>
				</Container>
			</section>			  
	    )
	}

	componentDidMount() {
		console.log(this.state.word);
	}
}

export default SearchFruits;
